// ——————————————————————————————————————————————
// 1) Look up your Calendar name (if you still need the invite step)
Set(
    _myCalendarName,
    LookUp(
        Office365Outlook.CalendarGetTables().value,
        DisplayName = "Calendar"
    ).Name
);
Set(
    varUserCalendarId,
    LookUp(
        Office365Outlook.CalendarGetTablesV2().value,
        name = "Calendar"
    ).id
);
// ——————————————————————————————————————————————
// 2) For each recurrence date…
ForAll(
    CollectionRecurrence As rec,
  // …and each selected desk…
    ForAll(
        colSelectedDesks As desk,
    // ——— (Optional) send the invite ———
        Office365Outlook.V4CalendarPostItem(
            varUserCalendarId,
            desk.Title,"2025-06-07T09:00:00","2025-06-08T10:00:00",
            //Text(varEndDate),
            "(UTC) Coordinated Universal Time",
            {
                // Main properties
                subject: "Reservation for " & desk.Title,
                body: "<p>You have reserved <b>" & desk.Title & "</b> on <b>" & "</b>.</p>",
                location: desk.Title,
                requiredAttendees: DataCardValue3.Selected.Email,
                optionalAttendees: Concat(
                    OptionAttendeesPP.SelectedItems,
                    Email & ";"
                ),
                //resourceAttendees: "room@yourdomain.com", // Update with your room/resource email or variable
                categories: varMeetCat,
                showAs: "busy",
                // free, tentative, busy, oof, workingElsewhere, unknown
                importance: "normal",
                // low, normal, high
                isAllDay: false,
                // true if all day
                recurrence: varRecurrenceFrequency,
                // "weekly", "daily", etc.
                selectedDaysOfWeek: [varFirstDayName].Value,
                // ["Monday"] or collection.Value
                recurrenceEnd: "2025-06-08",//DateValue(varEndDate),
                numberOfOccurences: varNumberOccurances,
                // integer
                reminderMinutesBeforeStart: 15,
                // integer
                isReminderOn: true,
                // or false
                responseRequested: true,
                // or true for RSVP
                sensitivity: "normal"// normal, personal, private, confidential
            }
        );
        // ——— Patch the SharePoint list ———
Patch(
            'Desk Reservations',
            Defaults('Desk Reservations'),
            {
                // simple string concatenation for Title
                Title: currentUser.FullName & " – " & desk.Title & " @ " & Text(
                    rec.StartDateTime,
                    "[$-en-US]mm/dd/yyyy hh:mm AM/PM"
                ),
                DeskText: desk.Title,
                'Check Out From': rec.StartDateTime,
                'Check Out From Text': Text(
                    rec.StartDateTime,
                    "[$-en-US]mm/dd/yyyy hh:mm AM/PM"
                ),
                'Check Out From Number': Value(
                    Text(
                        rec.StartDateTime,
                        "yyyymmddhmm"
                    )
                ),
                'Check Out To': rec.EndDateTime,
                'Check Out To Text': Text(
                    rec.EndDateTime,
                    "[$-en-US]mm/dd/yyyy hh:mm AM/PM"
                ),
                'Check Out To Number': Value(
                    Text(
                        rec.EndDateTime,
                        "yyyymmddhmm"
                    )
                ),
                // use the people‐picker cards directly (they include Department, etc.)
                'Reserved By': DataCardValue3.Selected,
                Manager: DataCardValue7.Selected,
                Service: DataCardValue8.Text,
                'Reason for desk reservation': DataCardValue1.Text,
                Asset: desk.Asset,
                DeskFloor: If(
                    desk.Asset.Value = "Desk",
                    desk.RoomLocation,
                    ""
                ),
                IsRecurring: tglIsRecurring.Checked,
                RecurrenceFrequency: varInterval2,
                RecurrenceEndDate: varLastEndDate,
                RecurrenceDayName: varFirstDayName,
                RecurrenceTimes: varRecurringtimes,
                RecurrenceID: varRecurrenceID,
                MeetingCatagory: varMeetCat,
                Description: varDescription,
                OptionalAttendees: OptionAttendeesPP.SelectedItems
            }
        )
    )
);
